import React from 'react';
import nsLogo from '../../assets/NS_logo_Regular.svg';
import classes from './Logo.module.css';


const logo = (props) => (
    
        <img  className={classes.Logo} src={nsLogo} alt="NS_Logo" />
);

export default logo;
